@bbqingwiththenolands is back at the smoker again with these amazing Smoked Carnitas. This recipe is easy to make as your smoker does the work for you cooking the pork low and slow. The pork is then finished at high heat with a bit of butter to get it crispy and delicious. A recipe that you will want to make again and again. 

